inline bool calc(int x){
  if(x < 10){
    return a[x] = (x == 7);
  }
  else{
    static int num[30];
    int ans = 0,cnt = 0;
    for(int t = x;t;t/=10){
      num[++cnt] = t % 10;
    }
    for(int i = cnt;i>1;i--){
      ans *= 10;
      ans += abs(num[i] - num[i-1]);
    }
    //printf("%d: ans:%d\n",x,ans);
    return a[x] = calc(ans);
  }
}

int query(int x){
  int ans = 0,now;
  for(int i = 0;;i++){
    if(t[i+1] == 0 || t[i+1] > x){
      ans = i*100;
      now = t[i];
      break;
    }
  }
  while(now < x){
    now++;
    if(calc(now)){
      ans++;
    }
  }
  return ans;
}

int main(){
  int A,B;
  scanf("%d %d",&A,&B);
  printf("%d\n",query(B)-query(A-1));
  return 0;
}